import './App.css';
import Login from './components/js/login';
import SignUpOne from './components/js/signUpOne';
import SignUpTwo from './components/js/signUpTwo';
import Productivity from './components/js/productivity';

import React, { useState } from 'react';

function App() {

  const [currentPage, setCurrentPage] = useState('home');

  function navigateTo(page) {
    setCurrentPage(page);
  }

  function renderPage() {
    switch(currentPage) {
      case 'login':
        return <Login navigateTo={Login} />;
      case 'signUpOne':
        return <SignUpOne navigateTo={SignUpOne} />;
      case 'signUpTwo':
        return <SignUpTwo navigateTo={SignUpTwo} />;
      case 'productivity':
        return <Productivity navigateTo={Productivity} />;
      default:
        return <NotFoundPage />;
    }
  }

  return (
    <>
    <div>
      <nav>
        <ul>
          <li onClick={() => navigateTo('home')}>Home</li>
          <li onClick={() => navigateTo('about')}>About</li>
          <li onClick={() => navigateTo('contact')}>Contact</li>
        </ul>
      </nav>
      {renderPage()}
    </div>
    </>
  );
}

export default App;
